INSERT INTO `clinics` VALUES (1,'تضم عيادة أمراض القلب بمستشفى أندلسية حي الجامعة أمهر أطباء وخبراء القلب في المملكة والشرق الأوسط، لتقديم خدمة ورعاية أفضل للمرضى بدءاً من التشخيص إلى العلاج، حيث ساعدت عيادة أمراض القلب في علاج ما يزيد على 2000 مريض، وأعادت لهم الأمل في حياة سعيدة وآمنة من جديد.','\n\nتضم عيادة أمراض القلب بمستشفى أندلسية حي الجامعة أمهر أطباء وخبراء القلب في المملكة والشرق الأوسط، لتقديم خدمة ورعاية أفضل للمرضى بدءاً من التشخيص إلى العلاج، حيث ساعدت عيادة أمراض القلب في علاج ما يزيد على 2000 مريض، وأعادت لهم الأمل في حياة سعيدة وآمنة من جديد.\n\n\\n\nوتتميز العيادة بخدمات استثنائية تساعد على أن تكون رحلة العلاج رحلة آمنة وبأقصى درجات الرعاية للمرضى، مثل:-\n\n\\n\n\n\n\\n\n\\n\nخدمة طوارئ القلب متوفرة 24 ساعة يومياً طوال أيام الأسبوع.\n\\n\nوجود استشاري قلب عند الطلب 24 ساعة يومياً طوال أيام الأسبوع.\n\\n\nوحدة رعاية القلب تعمل على مدار 24 ساعة يومياً.\n\\n\n\\n\n\n\n\\n\nالخدمات التي تقدمها عيادة أمراض القلب:-\n\\n\n\\n\nإجراء قسطرة القلب التشخيصية والعلاجية.\n\\n\nعلاج أمراض القلب الروماتيزمية والوراثية.\n\\n\nفشل وتضخم عضلة القلب.\n\\n\nتركيب صمامات ودعامات القلب.\n\\n\nعلاج عدم انتظام ضربات القلب.\n\\n\nعلاج أمراض الشرايين التاجية.\n\\n\nالذبحة الصدرية وجلطة القلب.\n\\n\nتصلب الشرايين.\n\\n\nرسم القلب العادي وبالمجهود.\n\\n\nفحص القلب بالموجات الصوتية (إيكو).\n\\n\nرسم القلب لمدة 24 ساعة (هولتر).\n\\n\n','حي الجامعة - شارع السيرة العطرة','0126806666','hjh.info@andalusiagroup.net','21.58323','29.953463','clinics\\January2020\\fuVVomxRgSDIEwQ6gogq.jpg','عيادة أمراض القلب،امراض القلب،دكتور امراض القلب','تضم عيادة أمراض القلب بمستشفى أندلسية حي الجامعة أمهر أطباء وخبراء القلب في المملكة والشرق الأوسط، لتقديم خدمة ورعاية أفضل للمرضى بدءاً من التشخيص إلى العلاج',1,'2020-01-29 06:34:00','2020-04-04 11:38:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,'تجربة وصف صغير ','\n\nوصف المنشور\n\n','تجرية ','555555555555','test@example.com',NULL,NULL,'clinics/April2020/jhPeaQXKjhtnAZFrnS7i.png','test','تجربة البيانات الاساسية بالعربي ',1,'2020-04-06 13:18:17','2020-04-06 13:18:28',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
