INSERT INTO `doctors` VALUES (1,'<p>بكالوريوس في طب وجراحة الفم والأسنان - الإجراءات والفحوصات التي تخص الأسنان- عمليات خلع الأسنان والخلع الجراحي- تنظيف الأسنان- بانوراما الأسنان - أشعة عادية على الأسنان بمستشفى حي الجامعة</p>','استشاري','أخصائي طب الأسنان','http://admin.alwstage.tk/storage/doctors/September2020/viTf9TzZObk2UiUzCxb2.png','','',1,'2020-04-07 21:10:27','2020-10-06 17:02:23',NULL,'ak@andalusiagroup.net','87965412','150','15',2,'male','SAR',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'بكالوريوس في طب وجراحة الفم والأسنان - الإجراءات والفحوصات التي تخص الأسنان- عمليات خلع الأسنان والخلع الجراحي- تنظيف الأسنان- بانوراما الأسنان - أشعة عادية على الأسنان بمستشفى حي الجامعة','شيماء عصام','shymaa-asam',12),(3,'<p>استشاري الجراحة العامة لفريقنا الطبي المميز بمستشفى أندلسية حي الجامعة.\\r\\n\\r\\nخبرة أكثر من 15 عامًا في الجراحة العامة، وحاصل على دكتوراه في الجراحة العامة من جامعة الأزهر بالقاهرة، وعمل كأخصائي أول للجراحة العامة بمستشفى جامعة ابن سينا بجدة</p>','استشاري','استشاري الجراحة العامة','http://admin.alwstage.tk/storage/doctors/September2020/55HcUvOmaPKM5W8qWTuD.png','','',1,'2020-04-07 21:10:27','2020-10-06 17:04:36',NULL,'Moustafa-Salama@Andalusiagroup.net','54741523','150','15',7,'male','SAR',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى وصف عربى ','أهداف عنان','ahdaf-anan',21),(4,'<p>ماجستير الأمراض الجلدية والتناسلية - التهاب الجلد والحكة والحساسية-البقع الجلدية البيضاء والملونة والهالات السوداء-السنطات والزوائد الجلدية-حب الشباب وآثاره</p>','أخصائي','أخصائي الأمراض الجلدية','http://admin.alwstage.tk/storage/doctors/September2020/KIV6oyqJXa6yKmDPhPh9.png','','',1,'2020-04-07 21:10:27','2020-10-06 17:03:04',NULL,'ahmed@andalusiagroup.net','74525368','75','15',5,'male','SAR',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'وصف ضغير','رانيا الباز','ranya-albaz',20),(5,'<p>لحاصلة على بكالوريوس في الطب من جامعة الإسكندرية 2005م، والحاصلة أيضاً على ماجستير في الأمراض الجلدية والتناسلية، بالإضافة إلى دبلومة في الطب التجميلي والليزر.بمستشفى حي الجامعة</p>','أخصائي','أخصائي الأمراض الجلدية','http://admin.alwstage.tk/storage/doctors/September2020/tcJJxYmqy47birOJWXmh.png','','',1,'2020-04-07 21:10:27','2020-10-06 17:02:55',NULL,'heba.ghazy@andalusiagroup.net','87452369','75','15',5,'female','SAR',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'وصف صغير','محمد إفريج','mhmd-ifryj',19),(6,'<p>ماجستير في الأنف والأذن والحنجرة - علاج التهاب اللوزتين والحلق وخراج خلف اللوزتين- النزيف الدموي من الأنف- الزدات الأنفية والانسداد</p>','أخصائي','أخصائى أنف وأذن وحنجرة','http://admin.alwstage.tk/storage/doctors/September2020/Y51SB5C0LiG6NZeVxaJD.png','','',1,'2020-04-07 21:10:27','2020-10-06 17:02:54',NULL,'ibram@andalusiagroup.net','58475125','75','15',5,'male','SAR',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'small desc ar','ميرفت عبد الحميد','myrft-abd-alhmyd',18),(7,'<p>ماجستير أمراض الباطنة - علاج أمراض الجهاز الهضمي والكبد- أمراض سوء الامتصاص والهضم- قرحة المعدة والأثنى عشر- مناظير الجهاز الهضمي- الكبد الدهني وتضخم الكبد- التهابات البنكرياس- القولون العصبي- التشخيص المبكر لأورام الجهاز الهضمي- الغدد الصماء والاضطراب الهرموني- حمى (الضنك &ndash; النزفية &ndash; الانفلونزا)- حمى (التيفويد &ndash; المالطية)- تشخيص مرض السكري والوقاية من مضاعفاته- آلام المفاصل الروماتيزمية- الروماتويد والذئبة الحمراء والأمراض المناعية- المغص والالتهابات الكلوية- الفشل الكلوي ومسبباته- منظار المعدة- منظار القولون- مناظير القنوات المرارية- تركيب بالون المعدة- ربط وحقن دوالي المرئ والمعدة- توسيع المرئ والقولون- استئصال اللحمية بالمنظار</p>','أخصائي','أخصائي أمراض الباطنة وأمراض الكلى','http://admin.alwstage.tk/storage/doctors/September2020/dHCzrDhwJmjhApEGTTi2.png','','',1,'2020-04-07 21:10:27','2020-10-06 17:02:48',NULL,'all@andalusiagroup.net','