INSERT INTO `services` VALUES (3,'وصف صغير عناية بالبشرة','<div class=\"serv-content position-relative\" style=\"background-image: url(\'https://admin.alwstage.tk/storage/services/October2020/NuaCTn4ZuYLCHqeV6Y2j.png\');\">\n<div class=\"d-none d-sm-block\">&nbsp;</div>\n<div class=\"container-fluid cont\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<h3 class=\"text-center text-capitalize mb-5\">أسنان<span style=\"color: #daa358;\">تبييض</span></h3>\n</div>\n<div class=\"col-md-6\">&nbsp;</div>\n<div class=\"col-md-6\">\n<p>ن حذاء Nike Air Max 270 ، وهو أول وحدة هوائية لنمط الحياة من Nike ، هو توازن القديم والجديد. صُممت لتحمل الارتداء طوال اليوم لممارسة الرياضة نمط الحياة ، لديه تصميم وميزات مع وضع الأداء في الاعتبار دون الحاجة إلى التضحية بأسلوب لا غنى عنه مثل Air Max المتابعون يتوقون إليه. يتباهى بهواء كعب مبالغ فيه الوحدة (الأطول حتى الآن قياس 32 مم) ، وهي عبارة عن حذاء رياضي ، وجزء علوي منسوج وشبك قابل للتنفس في العديد من الألوان بشكل جماعي يدلي ببيان ويعطي الصورة الظلية توقيعًا المظهر الذي حصل على موافقة مدراء الأحذية الرياضية ، Nike Air Max المتابعين ، وسوق الأحذية الرياضية بشكل عام.</p>\n</div>\n</div>\n<div class=\"row\">\n<div class=\"col-md-12\">\n<h3 class=\"text-center text-capitalize mb-5\">اسنان <span style=\"color: #daa358;\">تبييض</span></h3>\n</div>\n<div class=\"col-md-6\">&nbsp;</div>\n<div class=\"col-md-6\">\n<p>ن حذاء Nike Air Max 270 ، وهو أول وحدة هوائية لنمط الحياة من Nike ، هو توازن القديم والجديد. صُممت لتحمل الارتداء طوال اليوم لممارسة الرياضة نمط الحياة ، لديه تصميم وميزات مع وضع الأداء في الاعتبار دون الحاجة إلى التضحية بأسلوب لا غنى عنه مثل Air Max المتابعون يتوقون إليه. يتباهى بهواء كعب مبالغ فيه الوحدة (الأطول حتى الآن قياس 32 مم) ، وهي عبارة عن حذاء رياضي ، وجزء علوي منسوج وشبك قابل للتنفس في العديد من الألوان بشكل جماعي يدلي ببيان ويعطي الصورة الظلية توقيعًا المظهر الذي حصل على موافقة مدراء الأحذية الرياضية ، Nike Air Max المتابعين ، وسوق الأحذية الرياضية بشكل عام.</p>\n</div>\n</div>\n<div class=\"row\">\n<div class=\"col-m