rich_text_box',62,'Site'),(75,'site.delivery_shipment_policy_ar','delivery and shipment policy (AR)',NULL,NULL,'rich_text_box',63,'Site'),(76,'site.privacy_policy','privacy policy',NULL,NULL,'rich_text_box',64,'Site'),(77,'site.privacy_policy_ar','privacy policy (AR)',NULL,NULL,'rich_text_box',65,'Site'),(78,'site.twitter','Twitter','https://www.twitter.com/',NULL,'text',11,'Site'),(79,'site.youtube','Youtube','https://www.youtube.com/',NULL,'text',12,'Site'),(80,'site.whatsapp','Whatsapp','https://www.whatsapp.com/',NULL,'text',13,'Site'),(81,'site.about_us_en','About us en','The Nike Air Max 270, which is Nike’s first lifestyle\r\nAir unit, is a balance of the old and the new.\r\nBuilt to withstand all-day wear for an active\r\nlifestyle, it has a design and features with\r\nperformance in mind without the need of\r\nsacrificing a must-have style that Air Max\r\nfollowers have been yearning for. It flaunts\r\nan exaggerated heel Air unit (the tallest yet\r\nmeasuring 32-mm), a bootie construction,\r\nand a breathable knit and mesh upper in numerous\r\ncolorways that collectively makes a statement\r\nand gives the silhouette a signature look that have\r\ngained the approval of sneakerheads, Nike Air Max\r\nfollowers, and the sneaker market in general.',NULL,'text_area',14,'Site'),(82,'site.about_us_ar','About us ar','حذاء Nike Air Max 270 ، وهو أسلوب الحياة الأول لشركة Nike\r\nوحدة الهواء ، توازن القديم والجديد.\r\nصُممت لتحمل الارتداء طوال اليوم لممارسة الرياضة\r\nنمط الحياة ، له تصميم وميزات مع\r\nالأداء في الاعتبار دون الحاجة\r\nالتضحية بأسلوب لا بد منه أن Air Max\r\nالمتابعون يتوقون إليه. يتفاخر\r\nوحدة هوائية كعب مبالغ فيها (الأطول حتى الآن\r\nقياس 32 مم) ، تصميم حذاء ،\r\nوجزء علوي منسوج وشبك قابل للتنفس في العديد\r\ncolorways التي تدلي بشكل جماعي ببيان\r\nويعطي الصورة الظلية مظهرًا مميزًا\r\nحصلت على موافقة مدراء الأحذية الرياضية ، Nike Air Max\r\nالمتابعين ، وسوق الأحذية الرياضية بشكل عا',NULL,'text_area',15,'Site'),(83,'site.about_us_image','About us image','settings/September2020/Xif2bInIYLJw00VbDfpy.png',NULL,'image',16,'Site'),(84,'site.about_us_image_title','about us image title','image title',NULL,'text',17,'Site'),(85,'site.about_us_image_alt','about us image alt','image alt',NULL,'text',18,'Site'),(86,'site.email','Email','biagiottitheme@gmail.com',NULL,'text',19,'Site'),(87,'site.appointments','Appointments','Saturday - Friday 24 Hours',NULL,'text',20,'Site'),(89,'site.about_us_small_ar','about_us_small_ar','حذاء Nike Air Max 270 ، وهو أسلوب الحياة الأول لشركة Nike\r\nوحدة الهواء ، توازن القديم والجديد.',NULL,'text_area',68,'Site'),(90,'site.about_us_small_en','about_us_small_en','The Nike Air Max 270, which is Nike’s first lifestyle\r\nAir unit, is a balance of the old and the new.',NULL,'text_area',69,'Site'),(92,'site.instagram','instagram','https://www.instagram.com/',NULL,'text',67,'Site'),(93,'site.contact_us_email','Contact us email','Fady.Eskandar@Andalusiagroup.net',NULL,'text',70,'Site'),(96,'site.journey_subtitle_ar','Journey subtitle arabic','Journey subtitle arabic',NULL,'text_area',72,'Site'),(97,'site.journey_subtitle_en','Journey subtitle english','Journey subtitle english',NULL,'text_area',73,'Site'),(98,'site.services_subtitle_ar','Services subtitle arabic','Services subtitle arabic',NULL,'text_area',74,'Site'),(99,'site.services_subtitle_en','Services subtitle english','Services subtitle english',NULL,'text_area',75,'Site'),(100,'site.doctors_subtitle_ar','Doctors subtitle arabic','Doctors subtitle arabic',NULL,'text_area',76,'Site'),(102,'site.doctors_subtitle_en','Doctors subtitle english','Doctors subtitle english',NULL,'text_area',77,'Site'),(104,'site.testimonials_subtitle_ar','Testimonials subtitle arabic','Testimonials subtitle arabic',NULL,'text_area',78,'Site'),(106,'site.testimonials_subtitle_en','Testimonials subtitle english','Testimonials subtitle english',NULL,'text_area',79,'Site'),(107,'site.events_subtitle_ar','Events subtitle arabic','Events subtitle arabic',NULL,'text_are