e gained the approval of sneakerheads, Nike Air Max followers, and the sneaker market in general.</p>\n</div>\n</div>\n<div class=\"row\">\n<div class=\"col-md-12\">\n<h3 class=\"text-center text-capitalize mb-5\"><span style=\"color: #daa358;\">Orthodontics</span></h3>\n</div>\n<div class=\"col-md-6\">&nbsp;</div>\n<div class=\"col-md-6\">\n<p>The Nike Air Max 270, which is Nike&rsquo;s first lifestyle Air unit, is a balance of the old and the new. Built to withstand all-day wear for an active lifestyle, it has a design and features with performance in mind without the need of sacrificing a must-have style that Air Max followers have been yearning for. It flaunts an exaggerated heel Air unit (the tallest yet measuring 32-mm), a bootie construction, and a breathable knit and mesh upper in numerous colorways that collectively makes a statement and gives the silhouette a signature look that have gained the approval of sneakerheads, Nike Air Max followers, and the sneaker market in general.</p>\n</div>\n</div>\n</div>\n</div>','2020-09-28 16:28:13','2020-10-12 12:38:53'),(499,'services','meta_keywords',5,'en','Meta Keywords en','2020-09-28 16:28:13','2020-09-28 16:28:13'),(500,'services','meta_description',5,'en','Meta Description en','2020-09-28 16:28:13','2020-09-28 16:28:13'),(501,'doctors','small_description',10,'en','وصف ضغير عربى','2020-09-28 16:46:04','2020-09-28 16:46:04'),(502,'testimonials','description',3,'en','I don\'t work with a glam squad to get me together for the red carpet, I reall\ny enjoy the time it takes to do it myself, to choose my clothes and do my own\nmakeup and my own hair.','2020-09-28 16:58:06','2020-09-28 16:58:06'),(503,'testimonials','description',5,'en','I don\'t work with a glam squad to get me together for the red carpet, I reall\ny enjoy the time it takes to do it myself, to choose my clothes and do my own\nmakeup and my own hair.','2020-09-28 16:59:23','2020-09-28 16:59:23'),(505,'posts','title',7,'en','The cosmetics world title ti